import React from "react";
import SHOP_DATA from "..//../shop-data";

export const Shop = () => {
  return (
    <div>
      <h1>I Am The Shop Page</h1>
      {SHOP_DATA.map(({ id, name }) => (
        <div key={id}>
          <h1>{name}</h1>
        </div>
      ))}
    </div>
  );
};
